import portada from "./media/Confirmar Asistencia/portada.png";
import faltan from "./media/Confirmar Asistencia/faltan.png";
import padres from "./media/Confirmar Asistencia/padres.png";
import ceremonia from "./media/Confirmar Asistencia/ceremonia.png";
import recepcion from "./media/Confirmar Asistencia/recepcion.png";
import regalos from "./media/Confirmar Asistencia/regalos.png";
import vestimenta from "./media/Confirmar Asistencia/vestimenta.png";
import mensaje from "./media/Confirmar Asistencia/mensaje.png";
import confirmar from "./media/Confirmar Asistencia/confirmar.png";
import aro from "./media/invitacion1/aro.png";
import aroefecto from "./media/invitacion1/aroefecto.gif";
import Flores from "./media/invitacion1/Flores.png";
import Flores2 from "./media/invitacion1/Flores2.png";
import PrincesaSapo4 from "./media/invitacion1/PrincesaSapo4.png";
import xv1 from "./media/invitacion1/xv1.jpeg";
import Verde_Manzana from "./media/invitacion1/Verde_Manzana.jpg"
import ornamento2 from "./media/invitacion1/ornamento2.png";


export default{
    "img1": portada,
    "img2": faltan,
    "img3": padres,
    "img4": ceremonia,
    "img5": recepcion,
    "img6": regalos,
    "img7": vestimenta,
    "img8": mensaje,
    "img9": confirmar,
    "aro" : aro,
    "aroefecto" : aroefecto,
    "flores" : Flores,
    "flores2" : Flores2,
    "princes" : PrincesaSapo4,
    "XV" : xv1,
    "fondo" : Verde_Manzana,
    "ornamentos" : ornamento2

}
